package com.company;

import java.util.*;

public class Main {

    public int minDeletions(String s) {
        TreeMap<Character, Integer> sMap = new TreeMap<Character, Integer>();
        for (int i = 0; i < s.length(); i++) {
            if (sMap.containsKey(s.charAt(i))) {
                int value = sMap.get(s.charAt(i));
                sMap.put(s.charAt(i), value + 1);
            } else {
                sMap.put(s.charAt(i), 1);
            }
        }

        Integer[] nums = new Integer[sMap.size()];
        int i = 0;
        for (Map.Entry<Character, Integer> entry:sMap.entrySet()) {
            nums[i++] = entry.getValue();
        }
        Arrays.sort(nums, Collections.reverseOrder());
        int ret = 0;
        for (int j = 1; j < nums.length; j++) {
            if (nums[j].equals(nums[j-1]) && nums[j] != 0) {
                nums[j] = nums[j] - 1;
                Arrays.sort(nums, Collections.reverseOrder());
                j -- ;
                ret ++;
            }
        }
        return ret;
    }


    public static void main(String[] args) {
	    Main solution = new Main();
	    int ret = solution.minDeletions("");
	    System.out.print(ret);

    }
}
